import "./Tours.css";
function Tours(props){
    return(
        <>
        <div className="content"></div>
       {props.data.map(obj=>{
           return(
        <div>

        <p>Name: {obj.name}</p>
        <img src={obj.image} alt={obj.name}/>
        </div>
           );
        })}
        </>
    );
}
export default Tours;
